IF OBJECT_ID('dbo.proc_transform_119', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_119;
GO
CREATE PROCEDURE dbo.proc_transform_119
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_119
    SET payload = LEFT(payload, 1000) + N'|V4-119|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_119;
END
